class Solution:
    def minFlips(self, L: List[List[int]]) -> int:
        ans=0
        for j in range (0,len(L)//2):
            for k in range (0,len(L[0])//2):
                count=L[j][k]+L[j][len(L[0])-1-k]+L[len(L)-1-j][k]+L[len(L)-1-j][len(L[0])-1-k]
                ans=ans+min(count,4-count)
        if len(L)%2==1 and len(L[0])%2==1:
            if L[len(L)//2][len(L[0])//2]==1:
                ans=ans+1
        # print(ans)
        count11=0
        count00=0
        count10=0
        if len(L[0])%2==1:
            for j in range (0,len(L)//2):
                if L[j][len(L[0])//2]==1 and L[len(L)-1-j][len(L[0])//2]==1:
                    count11=count11+1
                if L[j][len(L[0])//2]==0 and L[len(L)-1-j][len(L[0])//2]==0:
                    count00=count00+1
                if L[j][len(L[0])//2]!=L[len(L)-1-j][len(L[0])//2]:
                    count10=count10+1
        if len(L)%2==1:
            for j in range (0,len(L[0])//2):
                if L[len(L)//2][j]==1 and L[len(L)//2][len(L[0])-1-j]==1:
                    count11=count11+1
                if L[len(L)//2][j]==0 and L[len(L)//2][len(L[0])-1-j]==0:
                    count00=count00+1
                if L[len(L)//2][j]!=L[len(L)//2][len(L[0])-1-j]:
                    count10=count10+1
        ans=ans+count10
        count11=count11%2
        # print(ans)
        # print(count11,count00,count10)
        while count10!=0:
            if count11==0 or count11==2:
                break
            count11=count11+1
            count10=count10-1
        if count11!=2:
            ans=ans+2*count11
        return ans
